eval("module.exports = \"<p>You&#39;re writing a strategy class. Your strategy class needs a <code>move</code> method. The <code>move</code> method must return a <code>Searcher</code> object or the name of your opponent&#39;s character.</p>\\n<h3 id=\\\"parameters\\\">Parameters</h3>\\n<p>The <code>move</code> method you write receives three parameters:</p>\\n<pre><code>me:    An object with information about your player.\\nother: An object with information about the other player.\\nlog:   A function that accepts strings you can review later.\\n</code></pre><p>The <code>me</code> object has three fields:</p>\\n<pre><code>board:  A `Board` object has two fields:\\n    remaining: An array of `Who` objects that you haven&#39;t yet\\n               rejected.\\n    rejected:  An array of `Who` objects that you have rejected.\\n\\nplayer: The strategy class itself. Check `player.name` to be sure.\\nwho:    Your own `Who` object. The one that your opponent is trying \\n        to guess.\\n</code></pre><p>The <code>other</code> object has the same structure, with some things blanked out. Each of their board arrays is the right length, but the values are <code>undefined</code>. Their <code>Who</code> is also undefined. </p>\\n<p>Their <code>player</code> class is intact, so you can check <code>player.name</code>, for example.</p>\\n<h3 id=\\\"who-objects\\\">Who Objects</h3>\\n<p>The <code>Who</code> objects are simple key-value objects. For example, the entry for Alex looks like this:</p>\\n<pre><code>{\\n    name: &#39;Alex&#39;,\\n    hair_color: &#39;black&#39;,\\n    mustache: true,\\n    eye_color: &#39;brown&#39;,\\n    bangs: true,\\n    gender: &#39;male&#39;,\\n}\\n</code></pre><h3 id=\\\"searcher\\\">Searcher</h3>\\n<p>If your <code>move</code> method passes back a <code>Searcher</code> object, the <code>Searcher</code> will be tested against the opponent&#39;s <code>Who</code>.</p>\\n<ul>\\n<li>If it matches, anything on your own board that doesn&#39;t match will be rejected.</li>\\n<li>If it doesn&#39;t match, anything on your own board that does match will be rejected.</li>\\n</ul>\\n<p>The <code>Searcher</code> object is built by calling <code>where</code>, <code>and</code> and <code>or</code>. </p>\\n<h4 id=\\\"examples-\\\">Examples:</h4>\\n<p>Match <code>Who</code> objects that have <code>eye_color</code> == &#39;brown&#39;:</p>\\n<pre><code>Searcher.where(&#39;eye_color&#39;, &#39;brown&#39;)\\n</code></pre><p>Match <code>Who</code> objects that have hat == true and gender == &#39;female&#39;:</p>\\n<pre><code>Searcher.where(&#39;hat&#39;, true&#39;).where(&#39;gender&#39;, &#39;female&#39;)\\n</code></pre><p>Match <code>Who</code> objects that have names with an e (case-insensitive) using regex:</p>\\n<pre><code>Searcher.where(&#39;name&#39;, /e/i)\\n</code></pre><p>Match <code>Who</code> objects that have either name == &#39;Philip&#39; or name == &#39;Max&#39;:</p>\\n<pre><code>Searcher.or([Searcher.where(&#39;name&#39;, &#39;Philip&#39;), Searcher.where(&#39;name&#39;, &#39;Anita&#39;])\\n</code></pre><p>Match <code>Who</code> objects that have (gender == &#39;female&#39; OR eye_color == &#39;brown&#39;) AND earrings == true:</p>\\n<pre><code>Searcher.or([Searcher.where(&#39;gender&#39;, &#39;female&#39;), Searcher.where(&#39;eye_color&#39;, &#39;brown&#39;)]).and(&#39;earrings&#39;, true)\\n</code></pre><p>You can find out if an object matches a <code>Searcher</code> using <code>test</code>.</p>\\n<pre><code>var who = {\\n    bald: true,\\n};\\nSearcher.where(&#39;bald&#39;, true).test(who); // yields true\\n</code></pre><h3 id=\\\"finishing-move\\\">Finishing Move</h3>\\n<p>When you return a string, the match ends. If you returned the name of the opponent&#39;s <code>Who</code>, then your strategy wins.</p>\\n<p>Otherwise your opponent&#39;s strategy wins by default.</p>\\n<h3 id=\\\"submitting-your-creation\\\">Submitting Your Creation</h3>\\n<p>When you write a strategy it just lives in your browser. A page refresh can destroy it (we&#39;ll work on local storage, soon). But you want the world to see it win big time.</p>\\n<ol>\\n<li>Fork the repo at <a href=\\\"https://github.com/dankuck/who-guessers\\\" target=\\\"_blank\\\">https://github.com/dankuck/who-guessers</a>.</li>\\n<li>Put your strategy in the <code>resources/assets/js/strategies</code> folder.</li>\\n<li>Add a <code>require</code> call in the <code>resources/assets/js/strategies/roster.js</code> file.</li>\\n</ol>\\n<p>Then submit a pull request back to us.</p>\\n<h3 id=\\\"no-memory-rule\\\">No Memory Rule</h3>\\n<p>Your class should not save any information anywhere for use in a later turn. That would be contradict the game notion that the board is all the memory you have.</p>\\n<p>To assist with this, your class is re-instantiated on each turn and all parameters given to it are re-copied. The effect is that you can make any changes you like to the parameters or the <code>this</code> object and trust that they will be reset for next time.</p>\\n\";//# sourceMappingURL=data:application/json;charset=utf-8;base64,");

